import React, { useState } from "react";
import { useSelector } from "react-redux";
import "./portfolio.css";
import backgroundImage from './Elevate_Your_Tech_Portfolio.png'; // Adjust the path as needed


const CustomNavbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const profile = useSelector((state) => state.userPortfolio.data.profile);

  const userName = profile?.fullName || "No Name";
  const userRole = profile?.roleTitle || "No Role";

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="portfolio-top d-flex justify-content-between align-items-center pt-1 pr-0 pl-10">

      <div className="left-column">
        <h2>{userName}</h2>
        <p>{userRole}</p>
      </div>

      <div className="right-column">
  <div className="top-row d-flex align-items-center">
    <div className={`dropdown ${isOpen ? "show" : ""}`}>
      <button
        className="btn btn-secondary dropdown-toggle"
        type="button"
        id="dropdownMenuButton"
        aria-expanded={isOpen}
        onClick={toggleDropdown}
      >
        <i className="bi bi-list"></i>
      </button>
      <div>
        <ul
          className={`dropdown-menu ${isOpen ? "show" : ""}`}
          aria-labelledby="dropdownMenuButton"
        >
          <li>
            <a className="dropdown-item" href="/about">
              About Devgree
            </a>
          </li>

          <li>
            <a className="dropdown-item" href="/dashboard">
              Return to Dashboard
            </a>
          </li>
        </ul>
      </div>
    </div>

    <span className="ms-3 fw-bold fs-4">Devgree</span>
  </div>

  <div className="bottom-row" style={{ backgroundImage: `url(${backgroundImage})` }}>


  </div>
</div>

    </nav>
  );
};

export default CustomNavbar;
